('GRID', 510, 121, 10, 'sum', '							//특정 컬럼 합계 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								tmp = mygrid{G.GRPID}.cells2(i,ind).getValue();\n								if($.isNumeric(tmp)){\n									out+= parseFloat(tmp);\n								}\n							}\n							//천단위 금액 표기\n							out = formatNumber(out);\n																			 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);	\n\n																			 ', '', '', '', 'R', 'I.FOOTERMATH=SUM&&I.FOOTERMATH=SUM', '', '20180828083218', '20181013060115'),
