('GRID', 510, 124, 30, 'min', '							//특정 컬럼 최소값 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								tmp = mygrid{G.GRPID}.cells2(i,ind).getValue();\n								if($.isNumeric(tmp) && out > parseFloat(tmp) ){																			 \n									out = parseFloat(tmp);\n								}\n							}\n							//천단위 금액 표기\n							out = formatNumber(out);\n																			 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);', '', '', '', 'R', 'I.FOOTERMATH=MIN', '', '20180829081552', '20181013060253'),
('GRID', 510, 125, 20, 'avg', '							//특정 컬럼 평균 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								tmp = mygrid{G.GRPID}.cells2(i,ind).getValue();\n								if($.isNumeric(tmp)){																			 \n									out+= parseFloat(tmp);\n								}\n							}\n							out = Math.round(out/mygrid{G.GRPID}.getRowsNum());\n												 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);\n', '', '', '', 'R', 'I.FOOTERMATH=AVG', '', '20180829081552', '20181013060149'),
